commits.content:
import 'package:monie_point/export.dart';

class NimvasColors {
  // Light Theme
  static const Color background = Color.fromRGBO(255, 255, 255, 1);
  static const Color border = Color.fromRGBO(204, 209, 211, 1);
  static const Color primary = Color.fromRGBO(13, 212, 92, 1);
  static const Color primaryText = Color.fromRGBO(28, 25, 57, 1);
  static Color secondaryText =
      const Color.fromRGBO(0, 0, 0, 1).withOpacity(0.4);
  static const Color logoColor = Color.fromRGBO(98, 144, 233, 1);
  static const Color redBox = Color.fromRGBO(195, 3, 3, 1);
  static const Color highlight = Colors.blue;
  static const Color addClient = Color.fromRGBO(3, 9, 164, 0.7);
  static const Color addTaxPayer = Color.fromRGBO(3, 9, 164, 1);
}
